INSERT INTO `trick` (`id`, `category_id`, `author_id`, `title`, `slug`, `description`, `created_at`, `updated_at`, `updated_by_id`) VALUES
	(1105, 101, 292, 'Stalefish', 'stalefish', 'Saisie de la carre backside de la planche entre les deux pieds avec la main arrière. Un grab consiste à attraper la planche avec la main pendant le saut. Un grab est d\'autant plus réussi que la saisie est longue. De plus, le saut est d\'autant plus esthétique que la saisie du snowboard est franche, ce qui permet au rideur d\'accentuer la torsion de son corps grâce à la tension de sa main sur la planche. On dit alors que le grab est tweaké (le verbe anglais to tweak signifie « pincer » mais a également le sens de « peaufiner »', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1106, 101, 288, 'Tail grab', 'tail-grab', 'Saisie de la partie arrière de la planche, avec la main arrière. Un grab consiste à attraper la planche avec la main pendant le saut. Un grab est d\'autant plus réussi que la saisie est longue. De plus, le saut est d\'autant plus esthétique que la saisie du snowboard est franche, ce qui permet au rideur d\'accentuer la torsion de son corps grâce à la tension de sa main sur la planche. On dit alors que le grab est tweaké (le verbe anglais to tweak signifie « pincer » mais a également le sens de « peaufiner »).', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1107, 101, 296, 'Truck driver', 'truck-driver', 'Saisie du carre avant et carre arrière avec chaque main (comme tenir un volant de voiture). Un grab consiste à attraper la planche avec la main pendant le saut. Un grab est d\'autant plus réussi que la saisie est longue. De plus, le saut est d\'autant plus esthétique que la saisie du snowboard est franche, ce qui permet au rideur d\'accentuer la torsion de son corps grâce à la tension de sa main sur la planche. On dit alors que le grab est tweaké (le verbe anglais to tweak signifie « pincer » mais a également le sens de « peaufiner »).', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1108, 101, 288, 'Indy', 'indy', 'Saisie de la carre frontside de la planche, entre les deux pieds, avec la main arrière. Un grab consiste à attraper la planche avec la main pendant le saut. Un grab est d\'autant plus réussi que la saisie est longue. De plus, le saut est d\'autant plus esthétique que la saisie du snowboard est franche, ce qui permet au rideur d\'accentuer la torsion de son corps grâce à la tension de sa main sur la planche. On dit alors que le grab est tweaké (le verbe anglais to tweak signifie « pincer » mais a également le sens de « peaufiner »', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1109, 101, 288, 'Mute', 'mute', 'Saisie de la carre frontside de la planche entre les deux pieds avec la main avant. Un grab consiste à attraper la planche avec la main pendant le saut. Un grab est d\'autant plus réussi que la saisie est longue. De plus, le saut est d\'autant plus esthétique que la saisie du snowboard est franche, ce qui permet au rideur d\'accentuer la torsion de son corps grâce à la tension de sa main sur la planche. On dit alors que le grab est tweaké (le verbe anglais to tweak signifie « pincer » mais a également le sens de « peaufiner »', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1110, 101, 290, 'Nose grab', 'nose-grab', 'Saisie de la partie avant de la planche, avec la main avant. Un grab consiste à attraper la planche avec la main pendant le saut. Un grab est d\'autant plus réussi que la saisie est longue. De plus, le saut est d\'autant plus esthétique que la saisie du snowboard est franche, ce qui permet au rideur d\'accentuer la torsion de son corps grâce à la tension de sa main sur la planche. On dit alors que le grab est tweaké (le verbe anglais to tweak signifie « pincer » mais a également le sens de « peaufiner »).', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1111, 102, 296, '360 ou trois six', '360-ou-trois-six', 'Un tour complet, soit 360 degrés. On désigne par le mot « rotation » uniquement des rotations horizontales ; les rotations verticales sont des flips. Le principe est d\'effectuer une rotation horizontale pendant le saut, puis d\'attérir en position switch ou normal. Une rotation peut être agrémentée d\'un grab, ce qui rend le saut plus esthétique mais aussi plus difficile car la position tweakée a tendance à déséquilibrer le rideur et désaxer la rotation. De plus, le sens de la rotation a tendance à favoriser un sens de grab plutôt qu\'un autre.', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1112, 102, 294, '1080 ou big foot ', '1080-ou-big-foot', 'Trois tours complet, soit 1080 degrés. On désigne par le mot « rotation » uniquement des rotations horizontales ; les rotations verticales sont des flips. Le principe est d\'effectuer une rotation horizontale pendant le saut, puis d\'attérir en position switch ou normal. Une rotation peut être agrémentée d\'un grab, ce qui rend le saut plus esthétique mais aussi plus difficile car la position tweakée a tendance à déséquilibrer le rideur et désaxer la rotation. De plus, le sens de la rotation a tendance à favoriser un sens de grab plutôt qu\'un autre.', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1113, 103, 293, 'Front flip', 'front-flip', 'Un flip est une rotation verticale. On distingue les front flips, rotations en avant, et les back flips, rotations en arrière. Il est possible de faire plusieurs flips à la suite, et d\'ajouter un grab à la rotation. Les flips agrémentés d\'une vrille existent aussi (Mac Twist, Hakon Flip...), mais de manière beaucoup plus rare, et se confondent souvent avec certaines rotations horizontales désaxées. Néanmoins, en dépit de la difficulté technique relative d\'une telle figure, le danger de retomber sur la tête ou la nuque est réel et conduit certaines stations de ski à interdire de telles figures dans ses snowparks..', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
	(1114, 103, 295, 'Back flip', 'back-flip', 'Un flip est une rotation verticale. On distingue les front flips, rotations en avant, et les back flips, rotations en arrière. Il est possible de faire plusieurs flips à la suite, et d\'ajouter un grab à la rotation. Les flips agrémentés d\'une vrille existent aussi (Mac Twist, Hakon Flip...), mais de manière beaucoup plus rare, et se confondent souvent avec certaines rotations horizontales désaxées. Néanmoins, en dépit de la difficulté technique relative d\'une telle figure, le danger de retomber sur la tête ou la nuque est réel et conduit certaines stations de ski à interdire de telles figures dans ses snowparks..', '2023-03-22 01:43:50', '2023-03-22 01:43:50', NULL),
